import React from 'react';
import BGSectionTopMobile from '../../assests/bg-section-top-mobile-1.svg';
import BGSectionTopDesktop from '../../assests/bg-section-top-desktop-1.svg';
import HuddleIllustrationExamples from '../../components/HuddleIllustrationExamples/HuddleIllustrationExamples';
import { IllustrationWrapper, IllustrationSection } from '../../components/styles/HuddleIllustration.styled';
import { Img } from '../../components/styles/HuddleIllustration.styled';
const Illustration = (props) => {
    return (
        <IllustrationSection>
            <Img Src={BGSectionTopMobile} Alt="mobile curved section" className='mobile' />
            <Img Src={BGSectionTopDesktop} Alt="desktop curved section" className="laptop"/>
            <IllustrationWrapper>
                <HuddleIllustrationExamples />
            </IllustrationWrapper>
        </IllustrationSection>
    );
}

export default Illustration;
